import img from './images/clothing.webp'
import './home.css';
import women from './images/women.jpeg';
import men from './images/men.jpeg'

const Home=()=>
{
    return(
<>
  <section>
    <div></div>
    <div id='homecontent'>
    <div id='men'>
      <img src={men}></img>
      <h1>"Elevate Your Style: Discover Men's Fashion Essentials"</h1>
    </div>
 
 <div id='women'>
  <img src={women}/>
  <h1>"Unveil Your Elegance: Explore Women's Fashion Collection"</h1>
 </div>
 </div>
  </section>

</>
    );
}

export default Home;
